  \"2016-10-15T16:36:19.108340\",\n\t\"name\": \"back-bay-plum-tree-island-national-wildlife-refuge-annual-narrative-report-calendar-year-1-9a47a\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Back Bay
  National Wildlife Refuge outlines Refuge accomplishments during the 1988 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  management planning, public participation, and compliance with environmental and
  cultural resource mandates. Refuge administration is outlined; information about
  personnel, youth programs, funding, and safety is given. Habitat management is also
  covered; subjects include wetlands, grasslands, fire management, and pest control.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, game mammals, animal
  control, and marking and bird banding. The public uses of the Refuge described in
  this report include outdoor classrooms, interpretive programs, hunting, fishing,
  trapping, wildlife observation, outdoor recreation, and law enforcement. The equipment
  and facilities section of the report provides information about new construction,
  major maintenance, equipment replacement, computer systems, and energy conservation.
  Cooperative programs, Refuge brochure and items of interest are provided at the
  end. Narrative for Plum Tree Island are attached.\",\n\t\"license_title\": \"License
